export class AccountService {
    constructor() {
        this.accounts = [
            {
                name: 'Master Account',
                status: 'active'
            },
            {
                name: 'Testaccount',
                status: 'inactive'
            },
            {
                name: 'Hidden Account',
                status: 'unknown'
            }
        ];
    }
    addAccount(name, status) {
        this.accounts.push({ name: name, status: status });
    }
    updateStatus(id, status) {
        this.accounts[id].status = status;
    }
}
